import React from "react";

const SlotMachine =(props)=>
{
    let x = props.x;
    let y = props.y;
    let z = props.z;

    if ((x === y) && (y===z))
    { 
        return(
            <>
                <h1 className="heading_style">
                    {" "}
                    {x} {y} {z}
                    <h1>This is matching...</h1>
                </h1>
                
                <hr  />
            </>
        )
    }else{
        return(
            <>
                <h1 className="heading_style">
                    {" "}
                    {x} {y} {z}
                    <h1>This is not matching...</h1>
                </h1>
                
                <hr  />
            </>
        )
    }

}

export default SlotMachine;
